DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `show_no` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `name` varchar(255) CHARACTER SET utf8 DEFAULT '',
  `name_en` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `name_hk` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `name_ja` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sold_number` int(11) DEFAULT NULL,
  `unit` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `images` varchar(400) COLLATE utf8_unicode_ci DEFAULT NULL,
  `images_en` varchar(400) COLLATE utf8_unicode_ci DEFAULT NULL,
  `images_hk` varchar(400) COLLATE utf8_unicode_ci DEFAULT NULL,
  `images_ja` varchar(400) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description_en` varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description_hk` varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description_ja` varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `comment` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `price` decimal(10,2) DEFAULT NULL,
  `original_price` decimal(10,2) DEFAULT NULL,
  `coin_price` decimal(18,8) DEFAULT NULL,
  `is_sale` tinyint(1) DEFAULT '0',
  `status` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=111 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

